import React from 'react';
import '../../KrunkySite.css';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Rating from '@material-ui/lab/Rating';

export const AboutPanel = () => {
    return (
        <>
            <div>All About Krunky</div>
            <Card raised style={{maxWidth: '400px'}}>
                <CardContent>
                    <div>Buffest man I know!</div>
                    <div><Rating name="read-only" value={5} readOnly /></div>
                    <div style={{alignItems: "right", display: "flex", flexDirection: "column"}}>- Anonymous</div>
                </CardContent>
            </Card>
            
        </>
    );
}
